const e=JSON.parse('{"key":"v-69305f26","path":"/moyu/redis/04_redis.html","title":"Redis 为什么这么快？","lang":"zh-CN","frontmatter":{"title":"Redis 为什么这么快？","subtitle":"Redis 为什么这么快？","category":["redis"],"tag":["摸鱼"],"order":4,"description":"概述 根据官⽅数据，Redis 的 QPS 可以达到约 100000（每秒请求数）; 横轴是连接数，纵轴是 QPS 基于内存实现 Redis 是基于内存的数据库，想对于磁盘来说,速度快了很多。 磁盘和内存的区别： 访问速度 内存是电子存储介质，可以在纳秒级别（10-9秒）的时间内完成读写操作。而磁盘是机械设备，需要寻找和移动读写头，这会导致较高的延迟，通常在毫秒级别（10-3秒）或更长的时间内完成读写。 物理性能 内存芯片位于计算机主板上，与处理器之间的距离非常近，数据传输路径很短。而磁盘通常是通过数据线连接到主板，数据传输路径较长，因此内存的物理性能更高。","head":[["meta",{"property":"og:url","content":"https://merryldt.github.io/moyu/redis/04_redis.html"}],["meta",{"property":"og:site_name","content":"魔力社区"}],["meta",{"property":"og:title","content":"Redis 为什么这么快？"}],["meta",{"property":"og:description","content":"概述 根据官⽅数据，Redis 的 QPS 可以达到约 100000（每秒请求数）; 横轴是连接数，纵轴是 QPS 基于内存实现 Redis 是基于内存的数据库，想对于磁盘来说,速度快了很多。 磁盘和内存的区别： 访问速度 内存是电子存储介质，可以在纳秒级别（10-9秒）的时间内完成读写操作。而磁盘是机械设备，需要寻找和移动读写头，这会导致较高的延迟，通常在毫秒级别（10-3秒）或更长的时间内完成读写。 物理性能 内存芯片位于计算机主板上，与处理器之间的距离非常近，数据传输路径很短。而磁盘通常是通过数据线连接到主板，数据传输路径较长，因此内存的物理性能更高。"}],["meta",{"property":"og:type","content":"article"}],["meta",{"property":"og:locale","content":"zh-CN"}],["meta",{"property":"og:updated_time","content":"2023-07-28T15:28:45.000Z"}],["meta",{"property":"article:author","content":"坎布里奇"}],["meta",{"property":"article:tag","content":"摸鱼"}],["meta",{"property":"article:modified_time","content":"2023-07-28T15:28:45.000Z"}],["script",{"type":"application/ld+json"},"{\\"@context\\":\\"https://schema.org\\",\\"@type\\":\\"Article\\",\\"headline\\":\\"Redis 为什么这么快？\\",\\"image\\":[\\"\\"],\\"dateModified\\":\\"2023-07-28T15:28:45.000Z\\",\\"author\\":[{\\"@type\\":\\"Person\\",\\"name\\":\\"坎布里奇\\",\\"url\\":\\"https://merryldt.github.io/\\"}]}"]]},"headers":[{"level":2,"title":"概述","slug":"概述","link":"#概述","children":[]},{"level":2,"title":"基于内存实现","slug":"基于内存实现","link":"#基于内存实现","children":[]},{"level":2,"title":"⾼效的数据结构","slug":"高效的数据结构","link":"#高效的数据结构","children":[]},{"level":2,"title":"线程模型","slug":"线程模型","link":"#线程模型","children":[{"level":3,"title":"6.0之前的单线程模型","slug":"_6-0之前的单线程模型","link":"#_6-0之前的单线程模型","children":[]},{"level":3,"title":"6.0之后的多线程","slug":"_6-0之后的多线程","link":"#_6-0之后的多线程","children":[]}]},{"level":2,"title":"I/O 多路复⽤模型","slug":"i-o-多路复用模型","link":"#i-o-多路复用模型","children":[]},{"level":2,"title":"高性能总结：","slug":"高性能总结","link":"#高性能总结","children":[]},{"level":2,"title":"内存与磁盘","slug":"内存与磁盘","link":"#内存与磁盘","children":[]}],"git":{"createdTime":1690544062000,"updatedTime":1690558125000,"contributors":[{"name":"kansuper","email":"17835059864@163.com","commits":2}]},"readingTime":{"minutes":10.06,"words":3017},"filePathRelative":"moyu/redis/04_redis.md","localizedDate":"2023年7月28日","excerpt":"<h2> 概述</h2>\\n<p>根据官⽅数据，Redis 的 QPS 可以达到约 100000（每秒请求数）;</p>\\n<figure><figcaption>横轴是连接数，纵轴是 QPS</figcaption></figure>\\n<h2> 基于内存实现</h2>\\n<p>Redis 是基于内存的数据库，想对于磁盘来说,速度快了很多。</p>\\n<blockquote>\\n<blockquote>\\n<p>磁盘和内存的区别：</p>\\n<ol>\\n<li>访问速度<br>\\n内存是电子存储介质，可以在纳秒级别（10<sup>-9秒）的时间内完成读写操作。而磁盘是机械设备，需要寻找和移动读写头，这会导致较高的延迟，通常在毫秒级别（10</sup>-3秒）或更长的时间内完成读写。</li>\\n<li>物理性能<br>\\n内存芯片位于计算机主板上，与处理器之间的距离非常近，数据传输路径很短。而磁盘通常是通过数据线连接到主板，数据传输路径较长，因此内存的物理性能更高。</li>\\n</ol>\\n</blockquote>\\n</blockquote>","autoDesc":true}');export{e as data};
